        console.log('Fetch Start: ' + round(fetchStart,2) + 'ms');
        console.log('DNS Start: ' + round(dnsStart,2) + 'ms');
        console.log('DNS End: ' + round(dnsEnd,2) + 'ms');
        console.log('Connect Start: ' + round(connectStart,2) + 'ms');
